import React, { useState } from "react";
import {
  Container,
  Typography,
  Card,
  CardContent,
  Grid,
  Button,
  CircularProgress
} from "@mui/material";
import { styled } from "@mui/system";
import axios from "axios";
import { ResponsiveContainer, LineChart, Line, XAxis, YAxis, CartesianGrid, Tooltip } from "recharts";

// Styled card with rounded corners + shadows
const StyledCard = styled(Card)(({ theme }) => ({
  borderRadius: "20px",
  boxShadow: "0px 4px 12px rgba(0,0,0,0.1)",
  backgroundColor: "#ffffff",
  height: "100%"
}));

export default function App() {
  const [transactions, setTransactions] = useState(null);
  const [payments, setPayments] = useState(null);
  const [profileText, setProfileText] = useState("");
  const [loading, setLoading] = useState(false);
  const [result, setResult] = useState(null);

  const handleSubmit = async () => {
    if (!transactions || !profileText) {
      alert("Please upload transactions and enter profile text.");
      return;
    }
    setLoading(true);
    const formData = new FormData();
    formData.append("profile_text", profileText);
    formData.append("transactions_file", transactions);
    if (payments) {
      formData.append("payments_file", payments);
    }

    try {
      const res = await axios.post("http://127.0.0.1:8000/investor_opportunity", formData, {
        headers: { "Content-Type": "multipart/form-data" }
      });
      setResult(res.data);
    } catch (err) {
      console.error(err);
      alert("Error fetching data.");
    }
    setLoading(false);
  };

  return (
    <Container maxWidth="lg" sx={{ padding: "20px" }}>
      <Typography variant="h4" sx={{ mb: 3, fontWeight: "bold" }}>
        Investor Opportunity Engine
      </Typography>

      {/* Upload + Input Section */}
      <Grid container spacing={2} sx={{ mb: 4 }}>
        <Grid item xs={12} md={4}>
          <StyledCard>
            <CardContent>
              <Typography variant="h6" gutterBottom>
                Upload Transactions
              </Typography>
              <input
                type="file"
                onChange={(e) => setTransactions(e.target.files[0])}
                style={{ marginBottom: "10px" }}
              />
              <Typography variant="h6" gutterBottom>
                Upload Payments (Optional)
              </Typography>
              <input
                type="file"
                onChange={(e) => setPayments(e.target.files[0])}
                style={{ marginBottom: "10px" }}
              />
              <Typography variant="h6" gutterBottom>
                Company Profile
              </Typography>
              <textarea
                placeholder="Enter company profile..."
                value={profileText}
                onChange={(e) => setProfileText(e.target.value)}
                style={{
                  width: "100%",
                  height: "100px",
                  borderRadius: "10px",
                  padding: "10px",
                  border: "1px solid #ccc",
                  resize: "none"
                }}
              />
              <Button
                variant="contained"
                fullWidth
                sx={{ mt: 2, borderRadius: "10px" }}
                onClick={handleSubmit}
              >
                Analyze
              </Button>
            </CardContent>
          </StyledCard>
        </Grid>

        {/* Results Section */}
        <Grid item xs={12} md={8}>
          {loading ? (
            <CircularProgress />
          ) : result ? (
            <Grid container spacing={2}>
              {/* Metrics Card */}
              <Grid item xs={12} sm={6}>
                <StyledCard>
                  <CardContent>
                    <Typography variant="h6">Key Metrics</Typography>
                    <pre style={{ whiteSpace: "pre-wrap", fontSize: "0.9rem" }}>
                      {JSON.stringify(result.metrics, null, 2)}
                    </pre>
                  </CardContent>
                </StyledCard>
              </Grid>

              {/* Risk Card */}
              <Grid item xs={12} sm={6}>
                <StyledCard>
                  <CardContent>
                    <Typography variant="h6">Risk Assessment</Typography>
                    <pre style={{ whiteSpace: "pre-wrap", fontSize: "0.9rem" }}>
                      {JSON.stringify(result.risk, null, 2)}
                    </pre>
                  </CardContent>
                </StyledCard>
              </Grid>

              {/* ROI Projections */}
              <Grid item xs={12}>
                <StyledCard>
                  <CardContent>
                    <Typography variant="h6">ROI Projections</Typography>
                    <ResponsiveContainer width="100%" height={300}>
                      <LineChart data={Object.entries(result.roi_projections.with_uplift || {}).map(([key, value]) => ({
                        name: key,
                        value: typeof value === "number" ? value : null
                      }))}>
                        <CartesianGrid strokeDasharray="3 3" />
                        <XAxis dataKey="name" />
                        <YAxis />
                        <Tooltip />
                        <Line type="monotone" dataKey="value" stroke="#1976d2" strokeWidth={2} />
                      </LineChart>
                    </ResponsiveContainer>
                  </CardContent>
                </StyledCard>
              </Grid>
            </Grid>
          ) : (
            <Typography variant="body1">Upload data and click "Analyze" to see results.</Typography>
          )}
        </Grid>
      </Grid>
    </Container>
  );
}
